import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        Google Books
      </a>

     <Link to={"/saved/" + book._id}><SaveBtn onClick={() => this.saveBook(book._id)} /> </Link>

    </nav>
  );
}

export default Nav;
